import React from 'react';

const VideoCard = ({ video }) => {
    return (
        <div className="item">
            <img className="ui image" src={video.snippet.thumbnails.medium.url} />
            <div className="content">
                {video.snippet.title}
            </div>
        </div>
    );
};

export default VideoCard;
